import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Spinner, Button, Form, Row, Col } from 'react-bootstrap'
import { useInput } from '../Data/useInput';
import { constraintCheck } from '../Data/ConstraintCheck';
import VaccinesList from '../Components/VaccinesSelectDropDown'
import { HttpRequest } from '../Data/HttpRequest';
import { Card } from '@material-ui/core';
let [acknowledgementList, acknowledgementData] = [[], null]
const DistributionList = (props) => {
    const [message, setMessage] = useState('')
    const config = {
        method: 'get',
        url: 'http://localhost:8765/api/distribution/acknowledge',
        headers: {
            'auth': localStorage.getItem('vmisJwt')
        }
    };
    const distributionData = HttpRequest(config, message);
    console.log(acknowledgementList);
    console.log(acknowledgementData);
    console.log(distributionData);
    return (<div>
        <Row>
            {Object.keys(distributionData.data).length > 0 ?

                <Col>
                    <Card>

                    </Card>
                </Col>
                :distributionData.loading?<Spinner animation={"border"}/>:distributionData.error?<div className="alert alert-danger">Something went wrong</div>:<div className="alert alert-info"></div>}

            <Col>

            </Col>
        </Row>
    </div>)
}

export default DistributionList;
